import React from 'react';
import '../App.css';
import {useState} from 'react';


function EmailContent() {
  return (
    <div>
        <header class="App-header">
            <label>Email nadawcy</label>
<input type='email' name='emailNadawcy' />
<label>Email odbiorcy</label>
<input type='email' name='emailOdbiorcy' />
<label>Tresc wiadomosci</label>
<textarea type='textarea' name='tresc'/>


      </header>
    </div>
  );
}

export default EmailContent;
